<style>
html, body {
    height: 100%;
    margin: 0;
    background-color: #111;
    display: flex;
    flex-direction: column;
    overflow: hidden;
}

/* Loading */
#loading {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    height: 100%;
    text-align: center;
}
.loading-balls {
    display: flex;
    gap: 10px;
    margin-bottom: 15px;
}
.ball {
    width: 15px;
    height: 15px;
    background: #ff0000;
    border-radius: 50%;
    animation: bounce 0.6s infinite alternate;
}
.ball:nth-child(2) { animation-delay: 0.2s; }
.ball:nth-child(3) { animation-delay: 0.4s; }
@keyframes bounce {
    from { transform: translateY(0); }
    to { transform: translateY(-15px); }
}
#loading-text {
    font-size: clamp(1.2rem, 4vw, 2rem);
    font-weight: 600;
    color: white;
}
/* Player */
#player {
    flex: 1;
    opacity: 0;
    visibility: hidden;
}

/* Upcoming event */
#upcoming {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    color: #ffffff;
    font-size: calc(1.5rem + 0.8vw);
    font-weight: 700;
    text-align: center;
    padding: 25px 35px;
    border-radius: 16px;
    box-shadow: 0 0 30px rgba(0, 212, 255, 0.6), 0 4px 15px rgba(0, 0, 0, 0.3);
    max-width: 85%;
    line-height: 1.4;
    animation: pulseGlow 2.5s infinite alternate;
    background: rgba(0,0,0,0.5);
    display: none;
}

/* Error message */
#error {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    font-size: calc(1.5vw + 1.5vh);
    text-align: center;
    background-color: #f44336;
    color: white;
    padding: 20px;
    border-radius: 10px;
    max-width: 80%;
    box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
    font-weight: bold;
    white-space: normal;
    word-wrap: break-word;
    display: none;
}

@keyframes pulseGlow {
    0% { box-shadow: 0 0 20px rgba(0, 212, 255,0.4), 0 4px 15px rgba(0,0,0,0.3); }
    50% { box-shadow: 0 0 40px rgba(0,212,255,0.7), 0 4px 20px rgba(0,0,0,0.35); }
    100% { box-shadow: 0 0 20px rgba(0,212,255,0.4), 0 4px 15px rgba(0,0,0,0.3); }
}

@media (max-width: 768px) {
    #upcoming { font-size: calc(1.2rem + 1vw); padding: 20px 25px; }
    #error { font-size: 3vw; padding: 6px 8px; }
}

@media (max-width: 480px) {
    #upcoming { font-size: calc(1rem + 1vw); padding: 15px 20px; }
    #error { font-size: 3vw; padding: 6px 8px; }
}
</style>
</head>

        <div class="ball"></div>
